import requests
import json

class FwdClient:
    def __init__(self):
        with open('config.json', 'r') as config_file:
            configs = json.load(config_file)
            self.username = configs['fwd']['username']
            self.password = configs['fwd']['password']
            self.endpoint = 'https://niw1itg937.execute-api.ap-southeast-1.amazonaws.com/Prod/verify'
    
    def verify(self, image):
        payload = {
            "base64image": image
        }
        r = requests.post(self.endpoint, json=payload, auth=(self.username, self.password))
        return r.json()

fwd_client = FwdClient()

if __name__ == "__main__":
    result = fwd_client.verify("""""")
    print(result)
